function App() {
  return (
    <>
 <Navbar/>
 <Particle id="tsparticles" />
 <hr style={{color:"rgb(182, 15, 197)"}}/>

 <Text/>

  <hr/>
  <div><Body1/></div>
  <div><Skill/></div>
  {/* <div><Education/></div> */}
